import React from "react";
import "./MensFashionPage.css";

const MensFashionPage = () => {
  const mensFashionItems = [
    {
      id: 1,
      title: "Men's Casual Shirt",
      description: "Premium cotton shirt for comfort and style.",
      price: "$29.99",
      image: "https://rukminim2.flixcart.com/image/612/612/xif0q/t-shirt/l/v/e/l-ts36-vebnor-original-imah4zb9rswzzbvc.jpeg?q=70", // Replace with actual image URLs
    },
    {
      id: 2,
      title: "Men's Leather Jacket",
      description: "High-quality leather jacket perfect for winter.",
      price: "$89.99",
      image: "https://via.placeholder.com/200x250",
    },
    {
      id: 3,
      title: "Men's Sneakers",
      description: "Stylish and comfortable sneakers for daily wear.",
      price: "$49.99",
      image: "https://via.placeholder.com/200x250",
    },
    {
      id: 4,
      title: "Men's Formal Suit",
      description: "Classic suit for business meetings and events.",
      price: "$199.99",
      image: "https://via.placeholder.com/200x250",
    },
  ];

  return (
    <div className="mens-fashion-page">
      <h1 className="page-title">Men's Fashion Collection</h1>
      <div className="fashion-items-container">
        {mensFashionItems.map((item) => (
          <div className="fashion-item" key={item.id}>
            <div className="item-image">
              <img src={item.image} alt={item.title} />
            </div>
            <div className="item-details">
              <h2 className="item-title">{item.title}</h2>
              <p className="item-description">{item.description}</p>
              <p className="item-price">{item.price}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MensFashionPage;
